import React from "react";

function Home() {
    return (
        <main className="main">
            <div className="main-container">
                <p>NEW YORK</p>
                <span></span>
                <h1><i>Welcome</i></h1>
                <span></span>
                <div className="hours">
                    <p>TODAY'S HOURS <br></br>
                    10 AM - 6 PM</p>
                </div>
                <img src="https://i.postimg.cc/bJmPZ1mG/flowers-home.png" alt="image"></img>
            </div>
            <div></div>
        </main>
    )
}

export default Home;
